import styled from "styled-components";

export const Wrapper = styled.div`
  padding: 1.25rem;
  margin-bottom: 1rem;
  width: 100%;
  border: 0;
  background-color: #eaeaea;
  input {
    background-color: transparent;
    width: 100%;
    ::placeholder {
      color: #666360;
    }
  }
`;
